import React from 'react';
import PropTypes from "prop-types"
import {Link} from "react-router-dom";


const Btn = (props) => {
    return (
        <React.Fragment>
            <Link to={process.env.PUBLIC_URL + "/workde"} className="btn btn-light btn-hover-primary">{props.name}</Link>
        </React.Fragment>
    )
}

export default Btn
